/* ================================================================================================================
Author :		Michael Duvoisin
Date :			2014
Description :	script for creating DB (TCCMDN)
================================================================================================================ */ 

/* connect to Master DB //////////////////////////////////////////////////////////////////////////////////////// */
USE master

/* Test if DB Exists /////////////////////////////////////////////////////////////////////////////////////////// */
IF EXISTS ( SELECT [name] FROM master.dbo.sysdatabases WHERE [name] = 'TCCMDN' )
BEGIN
	ALTER DATABASE TCCMDN SET SINGLE_USER WITH ROLLBACK IMMEDIATE
	DROP DATABASE TCCMDN
END
GO



/* create and connect to TCCMDN    //////////////////////////////////////////////////////////////////////////////////////// */
CREATE DATABASE TCCMDN
GO
USE TCCMDN

/* STRUCTURE =================================================================================================== */

/* create table person  //////////////////////////////////////////////////////////////////////////////////////// */
CREATE TABLE person(
	[IDPerson] [int] IDENTITY(1,1) NOT NULL,
	[dateCreation] [datetime] NOT NULL,
	[dateLastUpdate] [datetime] NULL,
	[status] int NOT NULL,
	[firstname] [nchar](100) NOT NULL,
	[lastname] [nchar](100) NOT NULL,
	[address] [text] NOT NULL,
	[telephone] [nchar](20) NOT NULL,
	[email] [nchar](100) NULL
 CONSTRAINT [IDPerson] PRIMARY KEY CLUSTERED 
(
	[IDPerson] ASC
)WITH (PAD_INDEX = OFF, STATISTICS_NORECOMPUTE = OFF, IGNORE_DUP_KEY = OFF, ALLOW_ROW_LOCKS = ON, ALLOW_PAGE_LOCKS = ON) ON [PRIMARY]
) ON [PRIMARY]


/* create table credential  /////////////////////////////////////////////////////////////////////////////////// */
CREATE TABLE credential(
	[IDCredential] [int] IDENTITY(1,1) NOT NULL,
	[dateCreation] [datetime] NOT NULL,
	[dateLastUpdate] [datetime] NOT NULL,
	[type] [int] NOT NULL,
	[status] [int] NOT NULL,
	[login] [nchar](50) NULL UNIQUE,
	[password] [nchar](255) NULL,
	[invitation] [int] NOT NULL,
	[validation] [int] NOT NULL,
	[FKPerson] [int] NOT NULL,
 CONSTRAINT [PK_credential] PRIMARY KEY CLUSTERED 
(
	[IDCredential] ASC
)WITH (PAD_INDEX = OFF, STATISTICS_NORECOMPUTE = OFF, IGNORE_DUP_KEY = OFF, ALLOW_ROW_LOCKS = ON, ALLOW_PAGE_LOCKS = ON) ON [PRIMARY]
) ON [PRIMARY]

GO

ALTER TABLE credential  WITH CHECK ADD  CONSTRAINT [FKPerson] FOREIGN KEY([FKPerson])
REFERENCES person ([IDPerson])
GO

ALTER TABLE [dbo].[credential] CHECK CONSTRAINT [FKPerson]
GO


/* create table subscription  /////////////////////////////////////////////////////////////////////////////////// */
CREATE TABLE subscription(
	[IDSubscription] [int] NOT NULL,
	[payed] [float] NOT NULL,
	[datePayment] [datetime] NOT NULL,
	[dateFor] [varchar](4) NOT NULL,
	[FKCredential] [int] NOT NULL,
 CONSTRAINT [PK_subscription] PRIMARY KEY CLUSTERED 
(
	[IDSubscription] ASC
)WITH (PAD_INDEX = OFF, STATISTICS_NORECOMPUTE = OFF, IGNORE_DUP_KEY = OFF, ALLOW_ROW_LOCKS = ON, ALLOW_PAGE_LOCKS = ON) ON [PRIMARY]
) ON [PRIMARY]

GO

SET ANSI_PADDING OFF
GO

ALTER TABLE subscription  WITH CHECK ADD  CONSTRAINT [FK_subscription_credential] FOREIGN KEY([FKCredential])
REFERENCES credential ([IDCredential])
GO

ALTER TABLE subscription CHECK CONSTRAINT [FK_subscription_credential]
GO

/* create table group  /////////////////////////////////////////////////////////////////////////////////// */
CREATE TABLE [dbo].[group](
	[IDGroup] [int] IDENTITY(1,1) NOT NULL,
	[dateCreation] [datetime] NOT NULL,
	[dateLastUpdate] [datetime] NOT NULL,
	[name] [varchar](100) NOT NULL,
	[FKCredential] [int] NOT NULL,
 CONSTRAINT [PK_group] PRIMARY KEY CLUSTERED 
(
	[IDGroup] ASC
)WITH (PAD_INDEX = OFF, STATISTICS_NORECOMPUTE = OFF, IGNORE_DUP_KEY = OFF, ALLOW_ROW_LOCKS = ON, ALLOW_PAGE_LOCKS = ON) ON [PRIMARY]
) ON [PRIMARY]

GO

SET ANSI_PADDING OFF
GO

ALTER TABLE [dbo].[group]  WITH CHECK ADD  CONSTRAINT [FK_group_credential] FOREIGN KEY([FKCredential])
REFERENCES credential ([IDCredential])
GO

ALTER TABLE [dbo].[group] CHECK CONSTRAINT [FK_group_credential]
GO

/* create table court  /////////////////////////////////////////////////////////////////////////////////// */
CREATE TABLE court(
	[IDCourt] [int] IDENTITY(1,1) NOT NULL,
	[dateCreation] [datetime] NOT NULL,
	[status] [int] NOT NULL,
	[name] [varchar](50) NOT NULL,
 CONSTRAINT [PK_court] PRIMARY KEY CLUSTERED 
(
	[IDCourt] ASC
)WITH (PAD_INDEX = OFF, STATISTICS_NORECOMPUTE = OFF, IGNORE_DUP_KEY = OFF, ALLOW_ROW_LOCKS = ON, ALLOW_PAGE_LOCKS = ON) ON [PRIMARY]
) ON [PRIMARY]

GO

/* create table courtConfig  /////////////////////////////////////////////////////////////////////////////////// */
CREATE TABLE courtConfig(
	[IDCourtConfig] [int] IDENTITY(1,1) NOT NULL,
	[dateCreation] [datetime] NOT NULL,
	[dateLastUpdate] [datetime] NOT NULL,
	[guestDaysBeforeBooking] [int] NOT NULL,
	[memberDaysBeforeBooking] [int] NOT NULL,
	[FKCourt] [int] NOT NULL,
 CONSTRAINT [PK_courtConfig] PRIMARY KEY CLUSTERED 
(
	[IDCourtConfig] ASC
)WITH (PAD_INDEX = OFF, STATISTICS_NORECOMPUTE = OFF, IGNORE_DUP_KEY = OFF, ALLOW_ROW_LOCKS = ON, ALLOW_PAGE_LOCKS = ON) ON [PRIMARY]
) ON [PRIMARY]

GO

ALTER TABLE courtConfig  WITH CHECK ADD  CONSTRAINT [FK_courtConfig_court] FOREIGN KEY([FKCourt])
REFERENCES court ([IDCourt])
GO

ALTER TABLE courtConfig CHECK CONSTRAINT [FK_courtConfig_court]
GO

/* create table config  /////////////////////////////////////////////////////////////////////////////////// */
CREATE TABLE config(
	[IDConfig] [int] IDENTITY(1,1) NOT NULL,
	[seasonBegin] [datetime] NOT NULL,
	[seasonEnd] [datetime] NOT NULL,
	[beginHour] [int] NOT NULL,
	[endHour] [int] NOT NULL,
	[courtsNumber] [int] NOT NULL,
	[graceNbDays] [int] NOT NULL,
 CONSTRAINT [PK_config] PRIMARY KEY CLUSTERED 
(
	[IDConfig] ASC
)WITH (PAD_INDEX = OFF, STATISTICS_NORECOMPUTE = OFF, IGNORE_DUP_KEY = OFF, ALLOW_ROW_LOCKS = ON, ALLOW_PAGE_LOCKS = ON) ON [PRIMARY]
) ON [PRIMARY]

GO

/* create table booking  /////////////////////////////////////////////////////////////////////////////////// */
CREATE TABLE booking(
	[IDBooking] [int] IDENTITY(1,1) NOT NULL,
	[dateCreation] [datetime] NOT NULL,
	[dateLastUpdate] [datetime] NOT NULL,
	[dateReservation] [datetime] NOT NULL CHECK ((dateReservation > GETDATE()) AND ((datepart(month,dateReservation)-datepart(month,GETDATE()))<1)),
	[recurrency] [int] NOT NULL,
	[beginHour] [int] NOT NULL,
	[endHour] [int] NOT NULL,
	[guestFirstname] [varchar](100) NULL,
	[guestLastname] [nchar](100) NULL,
	[FKCredential_Booker] [int] NOT NULL,
	[FKCredential_Guest] [int] NULL,
	[FKGroup] [int] NULL,
	[FKCourt] [int] NOT NULL,
	[statusPayment] [int] NOT NULL,
 CONSTRAINT [PK_booking] PRIMARY KEY CLUSTERED 
(
	[IDBooking] ASC
)WITH (PAD_INDEX = OFF, STATISTICS_NORECOMPUTE = OFF, IGNORE_DUP_KEY = OFF, ALLOW_ROW_LOCKS = ON, ALLOW_PAGE_LOCKS = ON) ON [PRIMARY]
) ON [PRIMARY]

GO

SET ANSI_PADDING OFF
GO

ALTER TABLE booking  WITH CHECK ADD  CONSTRAINT [FK_booking_court] FOREIGN KEY([FKCourt])
REFERENCES court ([IDCourt])
GO

ALTER TABLE booking CHECK CONSTRAINT [FK_booking_court]
GO

ALTER TABLE booking  WITH CHECK ADD  CONSTRAINT [FK_booking_credential] FOREIGN KEY([FKCredential_Booker])
REFERENCES credential ([IDCredential])
GO

ALTER TABLE booking CHECK CONSTRAINT [FK_booking_credential]
GO

ALTER TABLE booking  WITH CHECK ADD  CONSTRAINT [FK_booking_credential1] FOREIGN KEY([FKCredential_Guest])
REFERENCES credential ([IDCredential])
GO

ALTER TABLE booking CHECK CONSTRAINT [FK_booking_credential1]
GO

ALTER TABLE booking  WITH CHECK ADD  CONSTRAINT [FK_booking_group] FOREIGN KEY([FKGroup])
REFERENCES [dbo].[group] ([IDGroup])
GO

ALTER TABLE booking CHECK CONSTRAINT [FK_booking_group]
